import React from "react";
import "./Contact.css";

function Contact() {
  const contactInfo = [
    {
      name: "ðŸ“§ Email",
      value: "yourname@example.com",
      link: "mailto:yourname@example.com",
      logo: null, // no logo for email
    },
    {
      name: "GitHub",
      value: "https://github.com/talha-xml",
      logo: "https://cdn.jsdelivr.net/gh/devicons/devicon/icons/github/github-original.svg",
      link: "https://github.com/talha-xml",
    },
    {
      name: "LinkedIn",
      value: "https://www.linkedin.com/in/talha-faizan-46158532a/",
      logo: "https://cdn.jsdelivr.net/gh/devicons/devicon/icons/linkedin/linkedin-original.svg",
      link: "https://www.linkedin.com/in/talha-faizan-46158532a/",
    },
  ];

  return (
    <div className="contact-page">
      <div className="contact-container">
        <h1>Contact Me ðŸ“¥</h1>
        <div className="contact-grid">
          {contactInfo.map((item, index) => (
            <div key={index} className="contact-card">
              {item.logo && (
                <img src={item.logo} alt={`${item.name} logo`} className="contact-logo" />
              )}
              <h3>{item.name}</h3>
              <a href={item.link} target="_blank" rel="noopener noreferrer">
                {item.value}
              </a>
            </div>
          ))}
        </div>
      </div>
    </div>
  );
}

export default Contact;
